    return (
        <div>
            <h1 className='artogether'>ArTogether</h1>
            <div className='sidebar__container'>
                <StickyBox className='sidebar'>
                    <div>Sidebar</div>
                </StickyBox>
                <div>Main Content</div>
            </div>
        </div>
    )
}

export default Sidebar
